import { ICategory, IProduct } from "../../types";

export const ProductsTable = ({
  product,
  category,
}: {
  key: string;
  product: IProduct;
  category: ICategory[];
}) => {
  return (
    <tr>
      <th>{product.name}</th>
      <th>
        {category.map((c) => {
          if (c._id === product._id) {
            return c.name;
          }
        })}
      </th>
      <th>{product.price}</th>
      <th>{product.amount}</th>
      <th>{product.image}</th>
    </tr>
  );
};
